import React, { Component } from "react";
import "./node.css";

class Node extends Component {
  state = {};

  render() {
    let grids = [];
    for (let i = 0; i < 100; i++) {
      grids.push(<div class="grid-item"></div>);
    }

    return (
      <div>
        <div class="grid-container">
          <div class="grid-item"></div>
        </div>
      </div>
    );
  }
}

export default Node;
